### 方法二：迭代（后序遍历）

我们也可以使用迭代的方法来实现后序遍历。迭代的方法需要使用栈来辅助。

#### 代码

```cpp
class Solution {
public:
	TreeNode* pruneTree(TreeNode* root) {
		if (root == nullptr) return nullptr;

		stack<TreeNode*> stk;
		TreeNode* last = nullptr;
		TreeNode* node = root;

		while (!stk.empty() || node != nullptr) {
			if (node != nullptr) {
				stk.push(node);
				node = node->left;
			}
			else {
				TreeNode* top = stk.top();
				if (top->right != nullptr && last != top->right) {
					node = top->right;
				}
				else {
					stk.pop();
					// 如果当前节点的值为0，且是叶子节点，则删除该节点
					if (top->val == 0 && top->left == nullptr && top->right == nullptr) {
						if (!stk.empty()) {
							TreeNode* parent = stk.top();
							if (parent->left == top) {
								parent->left = nullptr;
							}
							else {
								parent->right = nullptr;
							}
						}
						else {
							// 如果栈为空，说明当前节点是根节点
							return nullptr;
						}
					}
					last = top;
				}
			}
		}
		return root;
	}
};
```

### 方法三：DFS（另一种递归）

我们也可以使用另一种递归方式，在递归函数中返回当前子树是否需要保留。

#### 代码

```cpp
class Solution {
public:
	TreeNode* pruneTree(TreeNode* root) {
		return containsOne(root) ? root : nullptr;
	}

	bool containsOne(TreeNode* node) {
		if (node == nullptr) return false;

		bool leftContainsOne = containsOne(node->left);
		bool rightContainsOne = containsOne(node->right);

		if (!leftContainsOne) node->left = nullptr;
		if (!rightContainsOne) node->right = nullptr;

		return node->val == 1 || leftContainsOne || rightContainsOne;
	}
};
```

